    "2016-05-27T02:33:07.794806",nt"name": "supplemental-colleges",nt"isopen":
    false,nt"url": null,nt"notes": "The Supplemental Colleges layer attempts
    to capture additional Post Secondary Education campuses of colleges and universities
    associated with a single campus listed in the Integrated Post Secondary Education
    System (IPEDS) or a college or university that has no representation in IPEDS. Included
    are Doctoral/Research Universities, Masters Colleges and Universities, Baccalaureate
    Colleges, Associates Colleges, Theological seminaries, Medical Schools and other
    health care professions, Schools of engineering and technology, business and management,
    art, music, design, Law schools, Teachers colleges, Tribal colleges, and other specialized
    institutions. The following process was followed for this first version of Supplemental
    CollegesSeveral enrollments were found through the public university websites and
    assigned to the appropriate records. For those records without enrollment, the enrollment
    from the main campus was spatially distributed to all campuses linked to the main
    campus based on the area. The area was determined by polygons outlining the campuses
    containing more than one building. An enrollment was assigned to the campuses that
    only contained one building. FTE was calculated as a percentage of the enrollment.
    ANY RESULTS OR CONCLUSIONS BASED ON THE ENROLLMENT AND FTE VALUES CONTAINED IN THIS
    LAYER SHOULD BE VERIFIED. This feature class contains all MEDS/MEDS+ as approved
    by NGA. For each field the 'Not available' and 'NULL' designations are used to indicate
    that the data for the particular record and field is currently unavailable and will
    be populated when and if that data becomes available.",nt"license_title": "License
